    [],nt"revision_timestamp": "2016-07-27T23:05:07.498196",nt"name": "marsh-and-water-management-plan-great-dismal-swamp-national-wildlife-refuge-1990",nt"isopen":
    false,nt"url": null,nt"notes": "Many people perceive swamps as having standing
    water year-round. However, this is not the case in the Dismal Swamp, and, in fact,
    most swamp vegetation could not survive permanent inundation. The Dismal Swamp has
    an annual hydrologic cycle which results in changing water levels throughout the
    year. This plan outlines management considerations and strategies when it comes
    to water levels, rainfall, vegetation changes, waterfowl and other wildlife use,
    planned water control structure setting for specific structures and the proper monitoring
    and recording of water level data.",nt"license_title": "License Not Specified",nt"extras":
